import React from 'react';
import { Carousel } from 'react-bootstrap';
import logo from './haridham-canada.jpg'
import './carousel.css';

const ImageCarousel = () => {
  return (
  
        <img
          className="main-width"
          src={logo}
          alt="First slide"
        />
 
      
  );
};

export default ImageCarousel;
